import '.\ExpenseItem.css';

function ExpenseItem(){
    return (
        <div className="expense-item">
            <div>
                <h2>Expense items..</h2>
            </div>

            <div>
                <p>Food Rs:10</p>
            <div>
                <p>Petrol Rs:100</p>
            </div>

            <div>
                <p>Movies Rs:200</p>
            </div>
            </div>
        </div>
    );
}

export default ExpenseItem;
